<?php

use \Psr\Http\Message\ServerRequestInterface as Request;
use \Psr\Http\Message\ResponseInterface as Response;

require 'vendor/autoload.php';

interface ServiceInterface {
    /**
     * Returns service version.
     *
     * @return integer
     */
    public function getVersion();

    /**
     * Returns image.
     *
     * @return string
     */
    public function getImage();
}

class Service implements ServiceInterface {

    /**
     * Returns service version.
     *
     * @return integer
     */
    public function getVersion()
    {
        return 1;
    }

    /**
     * Returns image.
     *
     * @return string
     */
    public function getImage()
    {
        // it's this image :)
        // https://www.telegraph.co.uk/content/dam/pets/2017/01/06/1-JS117202740-yana-two-face-cat-news_trans_NvBQzQNjv4BqJNqHJA5DVIMqgv_1zKR2kxRY9bnFVTp4QZlQjJfe6H0.jpg?imwidth=450
        return "";
    }
}


$app = new \Slim\App;

$app->getContainer()["service"] = function ($c) {
    return new Service();
};

$app->get('/version', function (Request $request, Response $response) {
    /** @var ServiceInterface $service */
    $service = $this->get('service');
    $response->getBody()->write($service->getVersion());

    return $response;
});

$app->get('/image', function (Request $request, Response $response) {
    /** @var ServiceInterface $service */
    $service = $this->get('service');

    $response->getBody()->write($service->getImage());

    return $response;
});


$app->run();

